import styled from 'styled-components'

export const MainContainer = styled.div`
background: black;
display: flex;
justify-content: center;
align-items: center;
height: 1000px;
position: relative;
z-index: 1;
`

export const MainBackground = styled.div`
height: 100%;
width: 100%;
top: 0;
right: 0;
bottom: 0;
left: 0;
position: absolute;
overflow: hidden;
`

export const VideoBackground= styled.div`
object-fit: cover;
width: 100%;
height: 100%;
background: black;
`
